import css from "./style.module.css";
import { Link } from "react-router-dom";
import { type } from "os";
import {Menu} from 'antd'
interface MenuType {
  categories: {
    id: number;
    type: string;
    label: string;
  }[];
}
export const MenuSide = (props: MenuType) => {
  return (
   <div>
     <Menu mode = "vertical">
      {props.categories.map((item) => (
<MenuItem>
            <Link to={`/${type}`}> {item.label} </Link>
            </MenuItem>
      ))}
         </Menu> 
</div>
  );
};
